USE retail;
CREATE TABLE tran_dtl (
   tran_id      VARCHAR(70)     NOT NULL,
   product_id   INT             NOT NULL,
   qty          INT             NOT NULL,
   amt          FLOAT(9,5)      NOT NULL,
   tran_dt      DATE            NOT NULL,
   PRIMARY KEY(tran_id,product_id,tran_dt)
);









